import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import jsPDF from 'jspdf';
import $ from 'jquery'
import domtoimage from 'dom-to-image';
//import Navbar from "./components/menu";
import "./App.css";
import "./acceuil.css";
import "./login.css";
// import "./font-awesome.min.css"

// Check for token to keep user logged in

class App extends Component {

  render() {
   let sty={
    color:"white"
   }
   let styl={
    background:"linear-gradient(40deg,#c700fa,#eb2af3,#d793c7)"
   }

     // function register(){

     //    document.querySelector(".register").style.display="block"
     // }
    return (
        <div>
          <div class=" navbar container-fluid" style={styl}>
            <div class="logo">
                <i class="fa fa-xing" style={sty} ></i>
                <span class="zion">Service Fokotany</span> 

            </div>
            <div class="connection"> <span class="connecter" onClick={()=> document.querySelector(".connect").style.display="block"}>Connecter</span></div>
          </div>

          <input type="color" id="couleur"/>
          <div class="menu2 container" >
             <div class=" row1 " >
                  <div class="  menu" >
                  <h3> Acceuil</h3>
                  </div>
                  <div class="  menu" >
                   <h3> Fifindramonina</h3>
                  </div>
                  <div class=" menu" >
                   <h3> Copie</h3>
                  </div>
              </div>
              <div class=" row1 " >
                  <div class=" menu" >
                   <h3 onClick={function(){
                    document.querySelector(".register").style.display="block"
                     document.querySelector(".inscription").style.transform="translateY(-700px)"
                   }}> Fisoratana Anarana</h3>
                  </div>
                  <div class="  menu" >
                    <h3> Fanamarinam-ponenana</h3>
                  </div>
                  <div class="  menu" >
                    <h3>Mombamomba</h3>
                  </div>
              </div>
          </div>

          <div className="register">
              <div class=" inscription">
                <form>
                    <h3>Inscription</h3>
                    <label for="name">Nom</label><br/><input placeholder="Anarana" />
                    <label for="name">Prenom</label><br/><input placeholder="Fanampina anarana"/>
                    <label for="name">Date et Lieu de naissance</label><br/><input placeholder="Date et Lieu de naissance"/>
                    <label for="name">Votre precedent quartier </label><br/><input placeholder="Fokotany nisy anao taloha  "/>
                    <label for="name">Adresse</label><br/><input placeholder="Adresse"/>
                    <label for="name">Numero telephone </label><br/><input placeholder="Numero telephone "/>
                    <label for="name">Mot de passe  </label><br/><input placeholder="Mot de passe " type="password"/>
                    <label for="name">Confirmer mot de passe</label><br/><input placeholder="Confirmer mot de passe " type="password"/>
                     <button className=" fermer btn-danger" >S inscrire</button>
                      <button className=" hiditra btn-danger" onClick={(e)=> { 
                      e.preventDefault()
                      document.querySelector(".register").style.display="none"}}> Retour</button>
                </form>   
              </div>
            </div>

            <div className="connect">
              <div class=" inscription1">
                <form>
                    <h3>Connection</h3>
                    <label for="name">Nom</label><br/><input placeholder="Nom" />
                    <label for="name">Votre quartier  </label><br/><input placeholder="Quartier  "/>
                    <label for="name">Mot de passe </label><br/><input placeholder="Mot de passe" type="password"/>
                     <button className=" fermer btn-danger" >Connecter</button>
                      <button className=" hiditra btn-danger" onClick={(e)=> { 
                      e.preventDefault()
                      document.querySelector(".connect").style.display="none"}}> Hiverina</button>
                </form>   
              </div>
            </div> 
        </div>
    );
  }
}
export default App;
